import React from 'react';
import { useRecordContext } from 'react-admin';
import { Box, makeStyles, Avatar, Chip } from '@material-ui/core';
import LaunchIcon from '@material-ui/icons/Launch';

const useStyles = makeStyles(theme => ({
  parent: props => ({
    position: 'relative',
    ...props.parent
  }),
  square: {
    width: '100%',
    paddingBottom: '100%',
    position: 'relative'
  },
  avatar: {
    position: 'absolute',
    top: 0,
    bottom: 0,
    width: '100%',
    height: '100%',
    borderRadius: '50%',
    // backgroundColor: theme.palette.primary.main,
    '& svg': {
      width: '55%',
      height: '55%'
    }
  },
  chip: {
    position: 'absolute',
    bottom: -10,
    left: 0,
    right: 0,
    paddingTop: 3,
    paddingBottom: 3,
    paddingLeft: 6,
    paddingRight: 6,
    marginBottom: 10,
    cursor: 'pointer'
  },
  launchIcon: {
    width: 14
  }
}));

const handleClick = () => {};

const AvatarWithLabelField = ({ label, defaultLabel, image, fallback, externalLink, labelColor, classes, ...rest }) => {
  classes = useStyles(classes);
  const record = useRecordContext();

  const computedLabel = (typeof label === 'function' ? label(record) : record[label]) || defaultLabel;
  const computedImage = typeof image === 'function' ? image(record) : record[image];
  const computedFallback = typeof fallback === 'function' ? fallback(record) : fallback;

  return (
    <Box className={classes.parent}>
      <div className={classes.square}>
        <Avatar
          src={computedImage || computedFallback}
          alt={computedLabel}
          fallback={computedFallback}
          {...rest}
          className={classes.avatar}
        />
      </div>
      {!computedLabel ? null : externalLink ? (
        <Chip
          color={labelColor}
          className={classes.chip}
          size="small"
          label={computedLabel}
          deleteIcon={<LaunchIcon className={classes.launchIcon} />}
          onDelete={handleClick}
        />
      ) : (
        <Chip color={labelColor} className={classes.chip} size="small" label={computedLabel} />
      )}
    </Box>
  );
};

AvatarWithLabelField.defaultProps = {
  labelColor: 'secondary',
  externalLink: false
};

export default AvatarWithLabelField;
import React from 'react';
import { ReferenceArrayField as RaReferenceArrayField } from 'react-admin';

const ReferenceArrayField = ({ record, source, ...otherProps }) => {
  if (record?.[source]) {
    if (!Array.isArray(record[source])) {
      record[source] = [record[source]];
    }
    record[source] = record[source].map(i => i['@id'] || i.id || i);
  }
  return <RaReferenceArrayField record={record} source={source} {...otherProps} />;
};

ReferenceArrayField.defaultProps = {
  addLabel: true
};

export default ReferenceArrayField;
import React from 'react';
import { ReferenceField as RaReferenceField } from 'react-admin';

const ReferenceField = ({ record, source, ...otherProps }) => {
  if (record[source]) {
    if (typeof record[source] === 'object') {
      record[source] = record[source]['@id'] || record[source].id;
    }
  }
  return <RaReferenceField record={record} source={source} {...otherProps} />;
};

ReferenceField.defaultProps = {
  addLabel: true
};

export default ReferenceField;
import React, { useEffect, useMemo, useState } from 'react';
import {
  getResources,
  useDataProvider,
  useRecordContext,
  linkToRecord,
  useGetResourceLabel,
  useTranslate
} from 'react-admin';
import { shallowEqual, useSelector } from 'react-redux';
import debounce from 'lodash.debounce';
import {
  Box,
  IconButton,
  List,
  ListItem,
  ListItemAvatar,
  ListItemText,
  ListItemSecondaryAction,
  Avatar,
  makeStyles,
  CircularProgress
} from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import VisibilityIcon from '@material-ui/icons/Visibility';
import ErrorIcon from '@material-ui/icons/Error';
import { useDataServers, useDataModel } from '@semapps/semantic-data-provider';

const useStyles = makeStyles(theme => ({
  root: {
    width: '100%',
    maxWidth: '100%',
    backgroundColor: theme.palette.background.paper,
    paddingTop: 0,
    paddingBottom: 0
  },
  primaryText: {
    width: '30%'
  },
  secondaryText: {
    fontStyle: 'italic',
    color: 'grey'
  }
}));

const getServerName = (resourceUri, dataServers) => {
  const server = dataServers && Object.values(dataServers).find(server => resourceUri.startsWith(server.baseUrl));
  return server ? server.name : 'Inconnu';
};

const ResultsList = ({ keyword, source, reference, appendLink, switchToCreate }) => {
  const classes = useStyles();
  const [loading, setLoading] = useState(false);
  const [loaded, setLoaded] = useState(false);
  const [results, setResults] = useState([]);
  const translate = useTranslate();
  const dataProvider = useDataProvider();
  const dataServers = useDataServers();
  const record = useRecordContext();

  const resources = useSelector(getResources, shallowEqual);
  const referenceDefinition = useMemo(() => {
    return resources.find(r => r.name === reference);
  }, [resources, reference]);
  const getResourceLabel = useGetResourceLabel();
  const dataModel = useDataModel(reference);

  if (dataModel && Object.keys(dataModel).length > 0 && !dataModel?.fieldsMapping?.title) {
    throw new Error(`No fieldsMapping.title config found for ${reference} dataModel`);
  }

  const search = useMemo(
    () =>
      debounce(keyword => {
        dataProvider
          .getList(reference, {
            pagination: { page: 1, perPage: 100 },
            sort: { field: dataModel?.fieldsMapping?.title, order: 'ASC' },
            filter: { q: keyword, _predicates: [dataModel.fieldsMapping.title], _servers: '@all' }
          })
          .then(({ data }) => {
            const existingLinks = record[source]
              ? Array.isArray(record[source])
                ? record[source]
                : [record[source]]
              : [];
            const newLinks = data.filter(record => !existingLinks.includes(record.id));
            setResults(newLinks);
            setLoaded(true);
            setLoading(false);
          })
          .catch(e => {
            setLoading(false);
          });
      }, 700),
    [dataProvider, dataModel, record, source, reference, setResults, setLoading, setLoaded]
  );

  useEffect(() => {
    if (!keyword) {
      return undefined;
    } else {
      setLoading(true);
      setLoaded(false);
      search(keyword);
    }
    return () => search.cancel();
  }, [keyword, search, setLoading]);

  if (!keyword) return null;

  return (
    <List dense className={classes.root}>
      {loaded &&
        results.map(resource => (
          <ListItem key={resource.id} button onClick={() => appendLink(resource.id)}>
            <ListItemAvatar>
              <Avatar>{React.createElement(referenceDefinition.icon)}</Avatar>
            </ListItemAvatar>
            <ListItemText className={classes.primaryText} primary={resource[dataModel.fieldsMapping.title]} />
            <ListItemText className={classes.secondaryText} primary={getServerName(resource.id, dataServers)} />
            <ListItemSecondaryAction>
              <a href={linkToRecord('/' + reference, resource.id, 'show')} target="_blank" rel="noopener noreferrer">
                <IconButton edge="end">
                  <VisibilityIcon />
                </IconButton>
              </a>
            </ListItemSecondaryAction>
          </ListItem>
        ))}
      {loaded && results.length === 0 && (
        <ListItem>
          <ListItemAvatar>
            <Avatar>
              <ErrorIcon />
            </Avatar>
          </ListItemAvatar>
          <ListItemText className={classes.primaryText} primary={translate('ra.navigation.no_results')} />
        </ListItem>
      )}
      {loaded && referenceDefinition.hasCreate && (
        <ListItem button onClick={switchToCreate}>
          <ListItemAvatar>
            <Avatar>
              <AddIcon />
            </Avatar>
          </ListItemAvatar>
          <ListItemText
            className={classes.primaryText}
            primary={translate('ra.page.create', { name: getResourceLabel(reference, 1) })}
          />
        </ListItem>
      )}
      {loading && (
        <Box display="flex" alignItems="center" justifyContent="center" height={150}>
          <CircularProgress size={60} thickness={6} />
        </Box>
      )}
    </List>
  );
};

export default ResultsList;
import React, { useState, useCallback } from 'react';
import { Button, useDataProvider, useTranslate, useRefresh, useNotify, useGetResourceLabel } from 'react-admin';
import { Dialog, DialogTitle, TextField, DialogContent, DialogActions, makeStyles } from '@material-ui/core';
import { Field, Form } from 'react-final-form';
import AddIcon from '@material-ui/icons/Add';
import ResultsList from './ResultsList';
import { useDataModel } from '@semapps/semantic-data-provider';

const useStyles = makeStyles(() => ({
  title: {
    paddingBottom: 8
  },
  actions: {
    padding: 15
  },
  addForm: {
    paddingTop: 0
  },
  listForm: {
    paddingLeft: 8,
    paddingRight: 8,
    paddingTop: 0,
    paddingBottom: 0,
    maxHeight: 210
  }
}));

const Input = ({ meta: { touched, error }, input: inputProps, ...props }) => (
  <TextField error={!!(touched && error)} helperText={touched && error} {...inputProps} {...props} fullWidth />
);

const QuickAppendDialog = ({ open, onClose, subjectUri, resource, source, reference }) => {
  const classes = useStyles();
  const [keyword, setKeyword] = useState('');
  const [panel, setPanel] = useState('find');
  const dataProvider = useDataProvider();
  const translate = useTranslate();
  const refresh = useRefresh();
  const notify = useNotify();
  const getResourceLabel = useGetResourceLabel();
  const dataModel = useDataModel(reference);

  const appendLink = useCallback(
    async objectUri => {
      // Get the freshest data so that the put operation doesn't overwrite anything
      const { data } = await dataProvider.getOne(resource, { id: subjectUri });

      await dataProvider.update(resource, {
        id: subjectUri,
        data: {
          ...data,
          [source]: data[source]
            ? Array.isArray(data[source])
              ? [...data[source], objectUri]
              : [data[source], objectUri]
            : objectUri
        },
        previousData: data
      });

      refresh();

      onClose();
    },
    [dataProvider, subjectUri, resource, source, refresh, onClose]
  );

  const create = useCallback(
    async values => {
      const { data } = await dataProvider.create(reference, {
        data: {
          [dataModel.fieldsMapping.title]: values.title
        }
      });

      await appendLink(data.id);

      notify(`La resource "${values.title}" a été créée`, 'success');
    },
    [dataProvider, dataModel, appendLink, reference, notify]
  );

  return (
    <Dialog fullWidth open={open} onClose={onClose}>
      {panel === 'find' ? (
        <>
          <DialogTitle className={classes.title}>Ajouter une relation</DialogTitle>
          <DialogContent className={classes.addForm}>
            <TextField
              autoFocus
              label={'Rechercher ou créer des ' + getResourceLabel(reference, 2).toLowerCase()}
              variant="filled"
              margin="dense"
              value={keyword}
              onChange={e => setKeyword(e.target.value)}
              fullWidth
            />
          </DialogContent>
          <DialogContent className={classes.listForm}>
            <ResultsList
              keyword={keyword}
              source={source}
              reference={reference}
              appendLink={appendLink}
              switchToCreate={() => setPanel('create')}
            />
          </DialogContent>
          <DialogActions className={classes.actions}>
            <Button label="ra.action.close" variant="text" onClick={onClose} />
          </DialogActions>
        </>
      ) : (
        <Form
          onSubmit={create}
          initialValues={{
            title: keyword
          }}
          render={({ handleSubmit, submitting }) => (
            <form onSubmit={handleSubmit}>
              <DialogTitle className={classes.title}>
                {translate('ra.page.create', { name: getResourceLabel(reference, 1) })}
              </DialogTitle>
              <DialogContent className={classes.addForm}>
                <Field
                  autoFocus
                  id="title"
                  name="title"
                  component={Input}
                  label="Titre"
                  disabled={submitting}
                  variant="filled"
                  margin="dense"
                />
              </DialogContent>
              <DialogActions className={classes.actions}>
                <Button
                  label="ra.action.create"
                  variant="contained"
                  startIcon={<AddIcon />}
                  type="submit"
                  disabled={submitting}
                />
                <Button label="ra.action.close" variant="text" onClick={onClose} />
              </DialogActions>
            </form>
          )}
        />
      )}
    </Dialog>
  );
};

export default QuickAppendDialog;
import React, { useState, useMemo } from 'react';
import { ReferenceArrayField as RaReferenceArrayField, usePermissionsOptimized } from 'react-admin';
import QuickAppendDialog from './QuickAppendDialog';

const QuickAppendReferenceArrayField = ({ record, reference, source, resource, ...otherProps }) => {
  const [showDialog, setShowDialog] = useState(false);
  const { permissions } = usePermissionsOptimized(record.id);

  const canAppend = useMemo(
    () => !!permissions && permissions.some(p => ['acl:Append', 'acl:Write', 'acl:Control'].includes(p['acl:mode'])),
    [permissions]
  );

  if (record?.[source]) {
    if (!Array.isArray(record[source])) {
      record[source] = [record[source]];
    }
    record[source] = record[source].map(i => i['@id'] || i.id || i);
  }

  return (
    <>
      <RaReferenceArrayField
        record={record}
        reference={reference}
        source={source}
        resource={resource}
        appendLink={canAppend ? () => setShowDialog(true) : undefined}
        {...otherProps}
      />
      {canAppend && showDialog && (
        <QuickAppendDialog
          open={showDialog}
          onClose={() => setShowDialog(false)}
          subjectUri={record.id}
          resource={resource}
          source={source}
          reference={reference}
        />
      )}
    </>
  );
};

QuickAppendReferenceArrayField.defaultProps = {
  addLabel: true
};

